CREATE PROCEDURE [dbo].[Usp_AddnewTeamMember]
	-- Add the parameters for the stored procedure here
	@LastName varchar(70),
	@FirstName varchar(70),
	@MiddleName varchar(70),
	@Gender varchar(70),
	@Profession varchar(70),
	@Phone varchar(70),
	@Cell varchar(70),
	@Email varchar(70),
	@dateofBirth datetime,
	@Company varchar(70),
	@Demographic varchar(70),
	@EmergencyContact varchar(70),
	@EmergencyPhone varchar(70),
	@HireDate DateTime,
	@TerminationDate Datetime,
	@Specialization varchar(70),
	@Address1 varchar(70),
	@Address2 varchar(70),
	@City varchar(70),
	@Province varchar(70),
	@PostalCode varchar(70),
	@CountryId bigint,
	@PhotoFilePath varchar(100)

AS

BEGIN -- SET NOCOUNT ON added to prevent extra result sets from -- interfering with SELECT statements. SET NOCOUNT ON;
IF @Keywordkey ='CareTeamMemberId' BEGIN SELECT g.[GenderId],p.[ProfessionalCategoryId], a.[addressId], [CareTeamMemberId], [LastName],[FirstName],[MiddleName], a.[Address1], a.[Address2],a.[City],a.[Province],a.[PostalCode], [PhoneNumber],p.[Name] as profession,g.[Name] as Gender,[CellNumber],[EmailAddress],[DateofBirth],[PlaceofBirth],[Company],[Demographic] ,[EmergencyContactName] ,[EmergencyContactPhoneNumber] ,[HireDate] ,[TerminationDate],[Specialization], [PhotoFilePath],a.CountryId, c.[CreateDate] FROM [CareTeamMember]c LEFT JOIN [dbo].[Address] a on c.[AddressId]= a.[AddressId] LEFT JOIN [dbo].[Gender] g ON c.[GenderId] = g.[GenderId] LEFT JOIN [dbo].[ProfessionalCategory] p ON c.[ProfessionalCategoryId] = p.[ProfessionalCategoryId] WHERE c.[CareTeamMemberId] =@Keywordvalue END ELSE IF @Keywordkey ='LastName' BEGIN SELECT g.[GenderId],p.[ProfessionalCategoryId], a.[addressId], [CareTeamMemberId], [LastName],[FirstName],[MiddleName],a.[Address1], a.[Address2],a.[City],a.[Province],a.[PostalCode],[PhoneNumber],p.[Name] as profession,g.[Name] as Gender,[CellNumber],[EmailAddress],[DateofBirth],[PlaceofBirth],[Company],[Demographic] ,[EmergencyContactName] ,[EmergencyContactPhoneNumber] ,[HireDate] ,[TerminationDate],[Specialization], a.CountryId,[PhotoFilePath],c.[CreateDate] FROM [CareTeamMember]c LEFT JOIN [dbo].[Address] a on c.[AddressId]= a.[AddressId] LEFT JOIN [dbo].[Gender] g ON c.[GenderId] = g.[GenderId] LEFT JOIN [dbo].[ProfessionalCategory] p ON c.[ProfessionalCategoryId] = p.[ProfessionalCategoryId] WHERE c.[LastName] =@Keywordvalue END ELSE IF @Keywordkey ='Phonenumber' BEGIN SELECT g.[GenderId],p.[ProfessionalCategoryId], a.[addressId], [CareTeamMemberId], [LastName],[FirstName],[MiddleName],a.[Address1], a.[Address2],a.[City],a.[Province],a.[PostalCode],[PhoneNumber],p.[Name] as profession,g.[Name] as Gender,[CellNumber],[EmailAddress],[DateofBirth],[PlaceofBirth],[Company],[Demographic] ,[EmergencyContactName] ,[EmergencyContactPhoneNumber] ,[HireDate] ,[TerminationDate],[Specialization], a.CountryId,[PhotoFilePath],c.[CreateDate] FROM [CareTeamMember]c LEFT JOIN [dbo].[Address] a on c.[AddressId]= a.[AddressId] LEFT JOIN [dbo].[Gender] g ON c.[GenderId] = g.[GenderId] LEFT JOIN [dbo].[ProfessionalCategory] p ON c.[ProfessionalCategoryId] = p.[ProfessionalCategoryId] WHERE c.[PhoneNumber] = @Keywordvalue OR c.[CellNumber] = @Keywordvalue END ELSE BEGIN SELECT g.[GenderId],p.[ProfessionalCategoryId], a.[addressId], [CareTeamMemberId], [LastName],[FirstName],[MiddleName],a.[Address1], a.[Address2],a.[City],a.[Province],a.[PostalCode],[PhoneNumber],p.[Name] as profession,g.[Name] as Gender,[CellNumber],[EmailAddress],[DateofBirth],[PlaceofBirth],[Company],[Demographic] ,[EmergencyContactName] ,[EmergencyContactPhoneNumber] ,[HireDate] ,[TerminationDate],[Specialization], a.CountryId,[PhotoFilePath],c.[CreateDate] FROM [CareTeamMember]c LEFT JOIN [dbo].[Address] a on c.[AddressId]= a.[AddressId] LEFT JOIN [dbo].[Gender] g ON c.[GenderId] = g.[GenderId] LEFT JOIN [dbo].[ProfessionalCategory] p ON c.[ProfessionalCategoryId] = p.[ProfessionalCategoryId]
END END

